You may have noticed that I don't use the terms "good" and "bad" foods.

Why? Many reasons. Firstly, they are overly simplistic terms to the point that are redundant.

To some people, a potato is a "bad food" because of it's high carbohydrate content. To other people it is delicious, satiating, not particularly expensive and tastes delicious when cooked with butter.

To some people, pizza is a "bad food" because it is normally high calorie, ultra-processed and high in loads of things people get overly paranoid over like gluten and dairy. To other people, pizza is good because enjoying it with your friends on a Friday night is good for your fucking soul.

There is no universally agreed upon definition of what "good" and "bad" foods are and even if there was, it is dose dependent. Don't penalise someone for eating a moderate amount of food they enjoy, you absolute ballbag.

Here is the other thing that people don't often consider, by giving people a strict list of binary food recommendations like things being "good" and "bad" it can have the unfortunate side effect of fucking up their relationship with food.

Rigid food control has been associated with higher BMIs, higher levels of anxiety and depression and higher incidence of binge eating than flexible control.

By giving people rigid black and white, all or nothing rules, you may make their relationship with food worse.

Paradoxically, you may also encourage them to eat more through the psychological consequences of enforcing strict food avoidance. You know, like the time you cut a laundry list of foods out of your diet and realised your nutrition plan was so difficult to stick to you had to plan in binge eating episodes masquerading as "cheat meals" to try and save your own sanity.

Not describing foods as "good" or "bad" isn't acknowledging that some foods are healthier than others. It is acknowledging that giving an overly simplistic and binary categorisation can be detrimental and we don't want to contribute to that.

Thank you for coming to my Ted talk.

